import React from "react";
import { Row, Col, Container } from "reactstrap";

export default class extends React.Component {
  render() {
    const { selectDetail } = this.props;
    const { tour_data } = selectDetail;
    return (
      <Container
        style={{
          backgroundColor: "#f6f6f6",
          paddingTop: 25,
          paddingBottom: 25
        }}
      >
        <Col style={{ marginLeft: 5, marginRight: 5 }}>
          <div>
            <Row>
              <Col>
                <b>DATA TOUR</b>
              </Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={3}>Title Tour</Col>
              <Col size={5}>: {!tour_data ? '-' : !tour_data.title ? '-' : tour_data.title}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={3}>Tour Hoster</Col>
              <Col size={5}>: {!tour_data ? '-' : !tour_data.host ? '-' : tour_data.host}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={3}>Category Name</Col>
              <Col size={5}>: {!tour_data ? '-' : !tour_data.category_name ? '-' : tour_data.category_name}</Col>
            </Row>
            <Row style={{ marginBottom: 5 }}>
              <Col size={3}>Duration Days</Col>
              <Col size={5}>: {!tour_data ? '-' : !tour_data.duration_days ? '-' : tour_data.duration_days + ' ' + 'Days' + ','}  {!tour_data ? '-' : !tour_data.duration_night ? '-' : tour_data.duration_night + ' ' + 'Night'}</Col>
            </Row>
          </div>
        </Col>
      </Container>
    );
  }
}
